import React, { useState } from "react";

function LeetCodeField() {
  const [leetCodeProfile, setLeetCodeProfile] = useState("");

  return (
    <div>
      <h3>LeetCode Profile</h3>
      <input
        type="text"
        value={leetCodeProfile}
        onChange={(e) => setLeetCodeProfile(e.target.value)}
        placeholder="Enter your LeetCode username"
      />
      <p>My LeetCode Profile: {leetCodeProfile}</p>
      {/* Here you can add links or additional info about your LeetCode achievements */}
    </div>
  );
}

export default LeetCodeField;
